Who wants some?!?

Tex-Mex Chopped Chicken Salad Recipe
Makes 4 servings and per serving you receive:
· 1 leaner protein
· 2 greens
· 3 condiments
Ingredients:
Dressing:
1 cup Walden Farms ranch dressing
2 Tbsp. Ortega taco seasoning, hot or mild
Salad:
24 ounces grilled chicken cooled and diced
4 cups Romaine lettuce, chopped, about 1 head
1/2 cup Roma tomatoes, diced
1/2 cup cucumber, seeded and diced
1/2 cup green onions, sliced
1/4 cup cilantro, chopped
6 Tsp. lime juice
1/2 cup of jalapeño & jicama mixed together
Directions
In a small bowl, stir together ingredients for dressing then refrigerate until ready to use.
In a large bowl, toss salad ingredients together. Add dressing a little at a time then toss until lightly coated.
Season with salt and pepper to taste. Serve immediately.";}i:56;a:1:{s:14:"comments_count";i:1;}i:57;a:1:{s:11:"likes_count";i:1;}i:58;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEu4ihPFYWm";}i:59;a:1:{s:5:"image";s:238:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/118779603_643461103273283_1296994023535143556_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=111&_nc_ohc=E75RAPdBjfMAX91aKas&oh=1d0284e714f66dcf5745bb6b5126e9fa&oe=5F7DE81A";}i:60;a:1:{s:4:"type";s:5:"image";}i:61;a:1:{s:8:"owner_id";i:39013424;}i:62;a:1:{s:14:"owner_username";s:0:"";}i:63;a:1:{s:14:"owner_fullname";s:0:"";}i:64;a:1:{s:9:"owner_pic";s:0:"";}i:65;a:1:{s:2:"id";s:19:"2391094933276015483";}i:66;a:1:{s:10:"short_code";s:11:"CEu4CxaJzt7";}i:67;a:1:{s:12:"created_time";i:1599260749;}i:68;a:1:{s:7:"caption";s:1922:"So much talk about GUT HEALTH lately. 

I am sure you’ve heard👂🏻 people say that:
✅  the gut is your second brain 🧠 (first actually)
✅ 80% of your immune system lies in your gut 

But did you know that:
✅ for every message from the brain 🧠 to the gut, there are 9 messages from the gut to the brain 🧠 
✅ you inherit your mother’s gut bacteria
✅ your intestines are 20-25 feet long
✅ you have a completely new lining of your intestines every 3-7 days 
✅ there are 100-150 times more genes 🧬 found in your microbiome than the 23,000 genes 🧬 found in your human DNA
✅ STRESS plays a major role in your gut health more then you’ll ever realize
✅ your gut keeps pathogens 🦠 out of your bloodstream. If you have a LEAKY GUT that’s where these little monsters are escaping into your bloodstream🩸, causing all kinds of health problems. LEAKY GUT is a precursor to many diseases. It is associated with lupus, type 1 diabetes, MS, fibromyalgia, arthritis, allergies, asthma, acne, obesity, IBS, Crohn’s, mental illness and even cancer
✅ your gut produces certain hormones such as thyroid hormones, hunger hormones, estrogen, serotonin, melatonin

💫 To say that your gut health should be an important PRIORITY is an understatement. 

💫 Eat only what’s good for your gut. 
“Eat plants 🌱. Mostly green. Not too much.” 
It’s hard to overeat on vegetables! 🥗
No food nourishes the body in more ways than plants. 

💫 Eliminate unhealthy, inflammation causing foods and beverages such as gluten, dairy, sugar, corn 🌽, soy, alcohol 🍺, soda 🥤 

💫 Detox your body and your digestive pathways. Detoxing is just like cleaning your home. What if you never cleaned your house? 
Our bodies store TOXINS 💀 in adipose tissue (fat) and that’s why many people are unable to loose weight. When you rid the body of toxins,the pounds will start falling off.";}i:69;a:1:{s:14:"comments_count";i:1;}i:70;a:1:{s:11:"likes_count";i:0;}i:71;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEu4CxaJzt7";}i:72;a:1:{s:5:"image";s:239:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/118793228_2027754707361874_8527456870140465371_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=110&_nc_ohc=8R1R2Kxo7RsAX8lsEgi&oh=22c7522914e7879deacf68b64e230c6f&oe=5F7B6B2C";}i:73;a:1:{s:4:"type";s:5:"image";}i:74;a:1:{s:8:"owner_id";i:8546825481;}i:75;a:1:{s:14:"owner_username";s:0:"";}i:76;a:1:{s:14:"owner_fullname";s:0:"";}i:77;a:1:{s:9:"owner_pic";s:0:"";}i:78;a:1:{s:2:"id";s:19:"2391094202091965037";}i:79;a:1:{s:10:"short_code";s:11:"CEu34IcMApt";}i:80;a:1:{s:12:"created_time";i:1599260662;}i:81;a:1:{s:7:"caption";s:1922:"So much talk about GUT HEALTH lately. 

